import './about.scss';
import { useState, useLayoutEffect, useRef } from 'react';
import LetsTalk from '../letsTalk/letsTalk';
import TextBlock from '../textBlock/textBlock';
import Image1 from './keyboard.jpg';
import Image2 from './amsterdam.jpg';
import Image3 from './face1.jpg';

const About = (): JSX.Element => {

    const title1: JSX.Element = <span key="title1_1">We are passionate about building digital solutions</span>;
    const text1: JSX.Element = <span key="text1_1">We like to design, build and maintain digital  products. We do this with passion and focus.</span>;

    const title2: JSX.Element = <span key="title2_1">What can Artificial Intelligence do for your organisation?</span>;
    const text2: JSX.Element = <span key="text2_1">Artificial Intelligence can help organisations grow in different directions. Check if your organisation is ready for it. </span>;

    const title3: JSX.Element = <span key="title3_1">Looking for a data-driven system?</span>;
    const text3: JSX.Element = <span key="text3_1">Let us help with structuring your data and optimze your descision making. </span>;

    return (
        <div className="about">

            <TextBlock title={title1} text={text1} />
            <img className="about__image-1" src={Image1} />

            <TextBlock title={title2} text={text2} />
            <img className="about__image-2" src={Image2} />

            <TextBlock title={title3} text={text3} />
            <img className="about__image-3" src={Image3} />

            <LetsTalk />
        </div>
    );
}

export default About;
